//Search by ingredients
//Cuisine
//Diet
//Changeable params

import axios from "axios"

const getData = async () =>{
    try{
        const res = await axios.get("https://api.spoonacular.com/recipes/complexSearch?apiKey=02ac4ff828e447bc82770977f42e5bd0&%26query%3Dlasagna%26cuisine%3D''%26number%3D10")
        const data = res.data;
        console.log(data)
    }catch(e){
        console.log(e)
    }
}

export const BackendTest = () => {
    getData();
    return (
      <div>backendTest</div>
    )
  }
  

